<?php
define("NGRAM", 15);
define("STRLENGTH", 2);
define("THRESHOLD", 5);

class Tokenizer {
	public function segmentation($content) {
		if(empty($content))
			return -1;
		mb_internal_encoding("UTF-8");
		$content = $this->_content_filter($content);
		$data = $this->_en_ch_split($content);
		$result = $this->_set_result($data);
		$result = $this->_get_kwds_only($result);
		return $result;
	}
	
	private function _get_kwds_only($result) {
		$new_res = [];
		foreach ($result as $val) {
			$new_res[] = $val["keyword"];
		}
		return $new_res;
	}
	
	private function _en_ch_split($content) {
		$ngram = NGRAM;
		$strlen = STRLENGTH;
		$threshold = THRESHOLD;
		$stop_words = $this->_get_stop_words();
		$content = str_replace($stop_words," ",$content);
		$seg_content = explode(" ", $content);
		$data = [];
		while($ngram >= $strlen) {
			$content = preg_replace('/[A-Za-z0-9_]/', '', $content);
			$terms = $this->_n_gram_algorithm($seg_content, $ngram);
			//arsort($terms);
			$data = $this->_extract_terms($data, $terms, $threshold, $strlen);
			$ngram --;
		}
		return $data;
	}
	
	private function _set_result($data) {
		$result = $frequency = $length = [];
		$i = 0;
		foreach ($data as $key => $value) {
			$length[$i] = strlen($key);
			$frequency[$i] = $value;
			$i++;
		}
		//array_multisort($frequency, SORT_DESC, $length, SORT_DESC,  $data);
		array_multisort($length, SORT_DESC,  $data);

		$i = 0;
		foreach($data as $k => $v) {
			if($k === 0) continue;
			//if($k < 10) continue;
			if(count($result) > 0) {
				$w = 0;
				foreach($result as $v2) {
					// 差距二次以內保留較長的
					if(strstr($v2['keyword'], $k)  && (abs($v2['frequency'] - $v) <= 2) ) {
						$w = 0;
						break;
					} else if(strstr($k, $v2['keyword'])  && (abs($v2['frequency'] - $v) <= 1) ) {
						$w = 0;
						//break;
					} else {
						$w = 1;
					}
				}
				if($w == 1) {
					$result[$i]['keyword'] = $k;
					$result[$i]['frequency'] = $v;
					$i++;
				}
			} else {
				$result[$i]['keyword'] = $k;
				$result[$i]['frequency'] = $v;
				$i++;
			}
		}

		if(count($result) < 1)
			return -1;
		// 重新以出現頻率高者排序在前
		$frequency = $length = [];
		foreach ($result as $key => $row) {
			$keyword[$key]  = $row['keyword'];
			$frequency[$key] = $row['frequency'];
			$length[$key] = strlen($row['keyword']);
			$encoding[$key] = mb_detect_encoding($row['keyword']) == 'ASCII' ? 1 : 0;
		}
		array_multisort($frequency, SORT_DESC, $encoding, SORT_DESC, $length, SORT_DESC,  $result);
		return $result;
	}
	
	private function _extract_terms($data, $terms, $threshold, $strlen) {
		$english_dict = $this->_get_eng_dictionary();
		foreach($terms as $k => $v) {
			if($v < $threshold)
				continue;
			if($k == '')
				continue;
			// 如果拆出來的字全都是英文
			if( mb_detect_encoding($k) == 'ASCII') {
				$va = 0;
				if(strlen($k) < 5)
					$va = isset($english_dict[$k]) ? 1 : 0;
				else $va = 1;
				if($va == 0 || strlen($k) < 5)
					continue;
			}

			if(mb_strlen($k) < $strlen)
				continue;
			$data["$k"] = $v;
		}
		return $data;
	}

	private function _n_gram_algorithm($seg_content, $ngram) {
		$terms = [];
		$conn_words = $this->_get_conn_words();
		foreach($seg_content as $pre_gram) {
			$last_pos = mb_strlen($pre_gram) - $ngram; 
			for($i = 0; $i <= $last_pos; $i++) {
				$tmp = mb_substr($pre_gram, $i, $ngram);
				$last_word = mb_detect_encoding(mb_substr($pre_gram, $i - 1, 1));
				$now_word = mb_detect_encoding(mb_substr($pre_gram, $i, 1));
				$first_word = mb_substr($tmp, 0, 1);
				$end_word = mb_substr($tmp, $ngram - 1, 1);
				if(isset($conn_words[$first_word])) 
					continue;
				if(isset($conn_words[$end_word])) 
					continue;
				//if($i > 1 && (  $last_word == 'ASCII' ||  $now_word == 'ASCII'))
					//continue;
				if(isset($terms["$tmp"]))
					$terms["$tmp"] ++;
				else
					$terms["$tmp"] = 1;
			}
		}
		return $terms;
	}

	private function _content_filter($content) {
		$content = preg_replace("#(^|[\n ])([\w]+?://[\w\#$%&~/.\-;:=,?@\[\]+]*)#is", " ", $content);
		$content = preg_replace('/<script\b[^>]*>(.*?)<\/script>/is', "", $content);
		$content = preg_replace('/<!--(.*?)-->/is', "", $content);
		$content = mb_strtolower(html_entity_decode($content));
		$content = str_replace('，', ', ', $content);
		$content = str_replace('。', '. ', $content);
		$content = str_replace('、', ', ', $content);
		$content = str_replace('？', '? ', $content);
		$content = str_replace('：', ': ', $content);
		$content = str_replace("\t", ' ', $content);
		$content = str_replace("\n", ' ', $content);
		return $content;
	}

